import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Admin() {
    const [transactions, setTransactions] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:9000/getTransactions') // Assuming your backend port and endpoint
            .then(response => {
                setTransactions(response.data);
            })
            .catch(error => {
                console.error('Error getting transactions', error);
            });
    }, []);

    return (
        <div className="AppContainer">
            <h1 className='Text'>Transactions</h1>
            {transactions.map((transaction, index) => (
                <div className="List" key={index}>
                    <div>User ID: {transaction.user_id}</div>
                    <div>File ID: {transaction.file_id._id}</div> 
                    <div>File Name: {transaction.file_id.name}</div> 
                    <div>Timestamp: {new Date(transaction.timeStamp).toLocaleString()}</div>
                    <div>Uploaded: {transaction.up ? "Yes" : "No"}</div>
                </div>
            ))}
        </div>
    );
}

export default Admin;
